var csCZ={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Dovolit","Allow in your wallet":"Povolte v peněžence","Allow {symbol} first":["Nejprve povolte ",["symbol"]],"Allowance pending":"Čeká se na příspěvek","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Při pokusu o provedení tohoto swapu došlo k chybě. Možná budete muset zvýšit toleranci skluzu. Pokud to nefunguje, může dojít k nekompatibilitě s tokenem, s nímž obchodujete. Poznámka: Poplatky za tokeny za převody a rebase nejsou kompatibilní s Uniswap V3.","Approval pending":"Čeká se na schválení","Approve":"Schválit","Approve Permit2":"Approve Permit2","Approve in your wallet":"Schvalujte v peněžence","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Nejprve schválit ",["symbol"]],"Auto":"Automaticky","Auto Router":"Auto Router","Auto Router API":"Auto Router API","Balance:":"Zůstatek:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Zavřít","Confirm in your wallet":"Potvrďte v peněžence","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Připojit peněženku","Connecting…":"Připojení…","Continue":"Continue","Convert {0} to {1}":["Převést ",["0"]," na ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Odpojit peněženku","Dismiss":"Zamítnout","Enter an amount":"Zadejte částku","Error fetching trade":"Chyba při načítání obchodu","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Načítání nejlepší ceny…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Vysoký skluz zvyšuje riziko pohybu cen","I don't have a wallet":"Nemám peněženku","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Nedostatečný zůstatek ",["0"]],"Invalid recipient":"Neplatný příjemce","Max":"Max.","Max slippage":"Maximální prokluz","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Chybějící závislosti","Network fee":"Síťový poplatek","No results found.":"Nebyly nalezeny žádné výsledky.","No tokens are available on this network. Please switch to another network.":"V této síti nejsou k dispozici žádné tokeny. Přepněte na jinou síť.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Zadejte prosím platný skluz %","Powered by the Uniswap protocol":"Využívá protokol Uniswap","Price impact":"Vliv ceny","Price updated":"Cena aktualizována","Reload":"Reload","Reload the page":"Znovu načtěte stránku","Request rejected":"Request rejected","Review swap":"Výměna recenze","Search by token name or address":"Vyhledávejte podle názvu tokenu nebo adresy","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Něco je špatně","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Úspěch","Swap":"Prohodit","Swap failed: {0}":["Výměna se nezdařila: ",["0"]],"Switch network":"Přepnout síť","Switch network in your wallet":"Přepněte síť v peněžence","Switching network":"Přepínací síť","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Konstanta Uniswap x*y=k nebyla swapem splněna. To obvykle znamená, že jeden z žetonů, které prohazujete, zahrnuje vlastní chování při přenosu.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Vstupní žeton nelze přenést. Možná je se vstupním žetonem nějaký problém.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Výstupní žeton nelze přenést. Možná je s výstupním žetonem nějaký problém.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Výstupní žeton nelze přenést. Může dojít k problému s výstupním žetonem. Poznámka: Poplatky za žetony za převody a rebase nejsou kompatibilní s Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Tato transakce nebude úspěšná z důvodu cenového pohybu. Zkuste zvýšit toleranci skluzu. Poznámka: Poplatky za žetony za převody a rebase nejsou kompatibilní s Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Tato transakce nebude úspěšná buďto z důvodu pohybu ceny, nebo z důvodu poplatku za převod. Zkuste zvýšit svou toleranci skluzu.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Lhůta pro transakce","Transaction rejected":"Transakce zamítnuta","Transaction submitted":"Transakce odeslána","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Zkuste zvýšit toleranci prokluzu.<0/>POZNÁMKA: Poplatky za převod a rebase tokeny nejsou kompatibilní s Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Neočekávaná chyba. Plyn pro výměnu se nepodařilo odhadnout.","Unexpected issue with estimating the gas. Please try again.":"Neočekávaný problém s odhadem plynu. Prosím zkuste to znovu.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Pohled na Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Varování","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Vaše transakce se vrátí zpět, pokud čeká na zpracování déle než toto časové období.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Jestliže se cena nepříznivě změní o více, než o tuto procentní hodnotu, Vaše transakce bude vzata zpět.","minutes":"minuty","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," poplatek"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

